import React from 'react';
import './nps.mp4';
import { Button } from 'react-bootstrap';

function Home() {
  return (
    <div>
      <h1>Welcome to the National Park Service Online Tour Guide!</h1>
      <Button>Browse Activities</Button>
      <col></col>
      <Button>Browse About</Button>
    </div>
  );
}

export default Home;
